import "./App.css";
import Navbar from "./Components/Navbar/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Category from "./Pages/Category";
import Product from "./Pages/Product";
import Shop from "./Pages/Shop";
import Cart from "./Pages/Cart";
import Auth from "./Pages/Auth";
import Footer from "./Components/Footer/Footer";
import electronics_banner from "./Components/Assets/banner_mens.png";
import sports_banner from "./Components/Assets/banner_women.png";
import accessories_banner from "./Components/Assets/banner_kids.png";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Shop />} />
          <Route path="/fashion" element={<Category category="fashion" />} />
          <Route
            path="/electronics"
            element={
              <Category banner={electronics_banner} category="electronics" />
            }
          />
          <Route
            path="/sports"
            element={<Category banner={sports_banner} category="sports" />}
          />
          <Route
            path="/accessories"
            element={
              <Category banner={accessories_banner} category="accessories" />
            }
          />
          <Route path="/product" element={<Product />}>
            <Route path=":productId" element={<Product />} />
          </Route>
          <Route path="/cart" element={<Cart />} />
          <Route path="/auth" element={<Auth />} />
        </Routes>
      </BrowserRouter>
      <Footer />
    </div>
  );
}

export default App;
